define({"topics" : [{"title":"Executing retroactively with time travel","shortdesc":"\n                  <p class=\"shortdesc\">How to perform retroactive execution of historical revisions of project         items.</p>\n               ","id":"task_ebp_tzn_ls","href":"TA_Help\/Topics\/ug_time_traveling_execution.html","menu": {"hasChildren":false,},"tocID":"task_ebp_tzn_ls-d46e26716","topics":[]},{"title":"Rules of time-traveling execution","shortdesc":"\n                  <p class=\"shortdesc\">You have the option of supplying a specific timestamp to determine which revision of the   given test module will be executed\n                     backward for the test run. It is possible that certain invoked   test module and other related project items will not have\n                     the revision that is exact matches with   your supplied timestamp. In this circumstance, <span class=\"ph\">TestArchitect</span>   applies a set of rules to determine the revision that is to be activated.\n                  </p>\n               ","id":"concept_ejv_3qv_ls","href":"TA_Help\/Topics\/ug_time_traveling_execution_rules.html","menu": {"hasChildren":false,},"tocID":"concept_ejv_3qv_ls-d46e26727","topics":[]},{"title":"Reviewing test results","shortdesc":"\n                  <p class=\"shortdesc\">Reviewing test results can assist you in verifying which revision of each related     project items is selected to run.</p>\n               ","id":"concept_nsz_nm4_ls","href":"TA_Help\/Topics\/ug_time_traveling_results.html","menu": {"hasChildren":false,},"tocID":"concept_nsz_nm4_ls-d46e26741","topics":[]}]});